package Basic.org;

class SwappingApp {

	public static void main(String[] x) {
		// TODO Auto-generated method stub
         int a=Integer.parseInt(x[0]);
         int b=Integer.parseInt(x[1]);
         int c;
         c=a;
         a=b;
         b=c;
         System.out.printf("%d\t%d",a,b);
        		 
	}

}
